package com.kuaixiu.sjUser.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-06 上午10:19:30 * @version: V 1.0 */public class SjUser extends BaseEntity {    /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *     */    private Integer id;    /**     * 登录id     */    private String loginId;    /**     * 密码     */    private String password;    /**     * 用户名字     */    private String name;    /**     * 用户联系方式     */    private String phone;    /**     * 用户类型  超级管理员：1   客户经理：2    施工单位：3   商机审核员：4   派单人员：5   客服：6   结算员：7  工人：8     */    private Integer type;    /**     * 是否注销   0否   1是     */    private Integer isCancel;    /**     * 是否删除  否0  是1     */    private Integer isDel;    /**     * 创建时间     */    private java.util.Date createTime;    /**     * 修改时间     */    private java.util.Date updateTime;    private String companyName;    private String pwd;    public String getPwd() {        return pwd;    }    public void setPwd(String pwd) {        this.pwd = pwd;    }    public Integer getId() {        return this.id;    }    public void setId(Integer id) {        this.id = id;    }    public String getLoginId() {        return this.loginId;    }    public void setLoginId(String loginId) {        this.loginId = loginId;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getName() {        return this.name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return this.phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public Integer getType() {        return this.type;    }    public void setType(Integer type) {        this.type = type;    }    public Integer getIsCancel() {        return this.isCancel;    }    public void setIsCancel(Integer isCancel) {        this.isCancel = isCancel;    }    public Integer getIsDel() {        return this.isDel;    }    public void setIsDel(Integer isDel) {        this.isDel = isDel;    }    public java.util.Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(java.util.Date createTime) {        this.createTime = createTime;    }    public java.util.Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime) {        this.updateTime = updateTime;    }    public String getCompanyName() {        return companyName;    }    public void setCompanyName(String companyName) {        this.companyName = companyName;    }}